        "title": "2022 LIFE UPDATE (what's next?)",
        "description": "What do you think about our 2022 plans? And Nate’s mustache? And would you vote for van life, international life, or physical challenges life?! Just curious! Thank y'all for watching and for being a part of our community ❤️ We are SO excited to get started on this year!\n\nEpisode 805 | Dallas, Texas | Filmed January 4, 2022\n\n📸 Follow us on Instagram for behind the scenes content! @karaandnate https://www.instagram.com/karaandnate/ \n\n✈️ We created FareDrop to help you score super cheap international flights! Try it for free and get flight deals up to 80% off ➡️ https://faredrop.com/ ⬅️\n\n📧 Sign up for our Sunday Summary email - https://karaandnate.com/sunday-summary/\n\n🎶 Download the copyright free songs we used in this episode: http://bit.ly/epidemic_sound\n\n——————————————————\n\n💳 Nate’s FREE guide to airport lounge access: http://karaandnate.com/the-ultimate-guide-to-lounge-access/ \n\n👩🏻‍💻 Kara’s Behind the Scenes Guide to Editing a Vlog:\nhttps://learn.karaandnate.com/p/how-to-edit-a-vlog/ \n\n🎥 Our current camera setup: https://karaandnate.com/travel-vlogging-gear/\n\n——————————————————\n\nSUPPORT OUR WORK: http://karaandnate.com/keep-us-on-the-road/ \n\nPACKING LIST: http://karaandnate.com/travel-essentials/ \n\nFACEBOOK: https://www.facebook.com/KaraandNate.Videos\nTWITTER: @karaandnate https://twitter.com/karaandnate\n\n——————————————————\n\nWho are Kara and Nate?! \nWatch our documentary here: https://www.youtube.com/watch?v=FuFv4iF8wgg&t=1s\n\nOriginally from Nashville, Tennessee, we got married 2013 and were super “normal.” I was a teacher and Nate started a small business from the spare bedroom of our apartment. We discovered the world of “travel hacking” & became obsessed.  So after 2 years of saving $35k and over 2 million miles and points, we sold our cars and apartment and left home January 10, 2016 for a “one year” trip around the world. Our goal was to see as many places as possible before we rean out of money and went home to normal life. We started this travel vlog to share our experiences with friends and family, but quickly fell in love with this lifestyle and did everything we could to keep going. 4 years later, we achieved our new goal of visiting 100 countries and all 7 continents. We had no plans to slow down, until 2020 forced us to ;) Which is when we bought a converted van to start exploring our own country for the first time. Van life was a major adjustment and so different than flying every week like we were used to, but we are incredibly thankful to be able to continue doing something we love every day. 😊🎥🌎 \n\n#travel #travelvlog #vanlife\n\n0:00 Nate has a mustache\n0:27 Why we’re making this video\n1:12 Marriage problems?\n1:45 Our 2021 recap\n2:46 Where we’ve been - the backstory\n5:41 Our identity crisis\n6:50 getting sentimental💗\n7:52 How we decide what to do\n9:12 Our 2022 plans!\n10:39 Where is the van?!\n14:50 Our passion project\n15:48 We love you",
