        "description": "10 Creepiest Things Caught On GoPro Camera!\n\nIf you're new, Subscribe! → http://goo.gl/djmfuX\n\nTop 5 Best is the #1 place for all your heart warming stories about amazing people that will inspire you everyday. Make sure to subscribe and never miss a single video!\n\n#viralstory #amazingpeople #top5best\n\n\n\nWe often talk about adventures and it seems that a lot of you are very eager to go out there and discover the exciting things that the world has to offer. And well, if you’re an adventurer, you probably have a gopro, or at least you travel with someone who has one. They are very practical cameras and they are very easy to bring them on the road and set them up pretty much anywhere to capture the most exciting parts of any adventurous trip. However, some people out there have found some surprises while exploring with their cameras and today we’ll  be looking at “10 of the creepiest things caught on gopro.” The people behind these videos were not aware that they would witness these shocking findings. Some of them even helped to solve mysteries that had been going on for years. Once you’re done watching this video, you will want to go out with a gopro and see if you can catch some interesting and perhaps, creepy footage.\n\nThe Underwater Car\n(https://www.youtube.com/watch?v=nWDVko2sRMQ)\n\nWhen teenager Max Werenka went to explore Griffin Lake in Canada, he spotted a strange rectangular object while being on his paddle board. After having a closer look, he realized it was a car. Everyone in the area thought it was a car that had not been removed after a terrible accident in 2009. However, when an officer came to the area for a picnic, he admitted that the car from 2009 had definitely been removed back then. The water was a bit murky and it didn’t allow the officer to spot the car, so Max went down and recorded everything with his gopro. The car was finally removed and soon enough, they found out that the car belonged to Janet Farris, a 70 year old woman who went missing back in 1992. She disappeared on the way to her niece’s wedding and her family never heard back from her again. Surely, it was relieving to the family to finally learn what had happened to this lady, even though they had already given up hope. \n\nBigfoot in the Forest\n\n(https://www.dailymail.co.uk/news/article-3745746/Was-Bigfoot-just-spotted-Oregon-Dog-GoPro-strapped-stumbled-bizarre-creature-forest.html)\n\nYou can strap a GoPro on different parts of your body, but you can also strap it to your dog’s body to sort of get a perspective from their point of view. I don’t know about you and your pets, but a lot of people like to do that. Thanks to that, a guy in Oregon was able to find some shocking footage that a lot of people claim to be a sight of Bigfoot. The guy and his dog went for their regular walk into the forest when they came across this strange figure that was standing like a human, but was very hairy and had the appearance of an ape. When the video went viral, a lot of people started to assume that it was definitely Bigfoot. Others, however, questioned the authenticity of the clip due to the dog’s reaction - the dog didn’t seem shocked or scared at all. So we can assume this dog is either very comfortable with Bigfoot around or the whole thing was set up. One thing is for sure...this is a creepy sight! \nTrainspotting\n(https://www.youtube.com/watch?v=M-yV9bzx7WQ number 5)\n\nYoutuber Brian Garcia and his friends were hanging out, when they found themselves in an experience that brought them very close to their deaths. It all happened around the train tracks in a neighborhood that’s very close to Los Angeles. Just like many teenagers out there, they thought it would be cool to explore a dark tunnel in which a lot of trains pass by. It all seemed  good and safe, and it seemed like they were going to be able to make it to the other side of the tunnel without a problem. Unfortunately, when they least expected it, a train was coming their way. They had to run for their lives and get out of the tunnel before being smashed by the huge machine. Luckily, they made it out alive, and they had a gopro that recorded the whole thing. The footage is certainly better than any action movie out there. These are real people that were close to losing their lives. The good thing is that they survived, and the video did not end in tragedy.\n\n\nExploring a Haunted House \n(https://www.youtube.com/watch?v=7kvfkWm4n-U number 12)\n\nI’m not sure how many of you are into this, but if you like exploring haunted houses, make sure you bring a gopro when you go in! Like this group of teenagers, who decided to explore a haunted house and see what was inside. As soon as you see the footage, you can see that the house has a very disturbing look. I mean, what else can you expect from a haunted house, right? Now, the creepiest part about this footage comes around the 5:53 minute mark in which we can see some sort of shadow lurking in the background. Is it a ghost?",
