        "title": "10 Dinosaurs Caught on Camera in Real Life",
        "description": "10 Dinosaurs Caught on Camera in Real Life\n\r\nIf you're new, Subscribe! → http://goo.gl/djmfuX\r\n\r\nFact File is the #1 place for all your heart warming stories about amazing people that will inspire you everyday. Make sure to subscribe and never miss a single video!\r\n\r\n#viral #amazing #FactFile #animals\n\n\nThe existence of dinosaurs has long intrigued the world of science as they were once the most successful species on the planet. Dinosaurs had lived their time and were wiped from the surface of the earth by asteroid bombs worth billions of Hiroshima. Who knows what they did wrong to have met with such a fatal end. \n\nScientists believe that not one dinosaur could have survived the apocalypse millions of years ago. And we have their fossil to tell us their story. However, recent evidence has popped up to foil that notion, and a lot of questions have ensued from it. What if the surviving dinosaurs only got better at hiding when humans came around?\n\nCould it be that they are afraid of our capabilities because we are smarter? Well, you are about to find out as we present ten of the dinosaurs caught on camera in real life. Do well to stay tuned to the end. They might just clear your doubts. \n\nNumber 10:  Velociraptor Caught in the Woods. \n\nYou can't start a list of dinosaurs and skip cool ones like t-rexes and velociraptors. Not with the significant roles they played in Jurassic Park. But, it seems that these vicious monsters managed to survive a mass extinction. And the films may not be the only place you get to see them. \n\nThough the source of this video is unknown, it does claim to show a velociraptor escaping into the woods. It's quite blurry at first, but when you zoom in, you'll surely see the magic. It's so unbelievable because we can't rationalize how a raptor survived for so long in that sparse bush. This plus many other questions have stirred lots of reactions among critics online. \n\nWhile some say that the creature came from the forest nearby where it fed on small unfortunate animals. Others are more skeptical, claiming that video could have been the work of a smart editor—one who may probably be playing on our intelligence or perhaps trying to garner more views. \n\nWell, if that's the case, we say \"hats off\" to the mastermind behind this video. Indeed, he has won the hearts of a million believers and doubters alike. The clip looks pretty real and convincing. \n\nhttps://www.google.com/amp/s/www.pinterest.com/amp/pin/448882287852634592/\n\n\nNumber 9: The Ohio Pterosaur\n\nFrom the enigma of the wow signal to the reincarnation of one of its inhabitants, far too many things are complicated to explain in Ohio. This footage about a dinosaur in the sky is just another on the list. \n\nWhen you look at the video, you'd see a bird flying. Soaring in all its majesty to entice any ordinary onlooker. We guess that's one of the first attractions which compelled the maker of this clip to document the scenery in the first place.\n\nUnfortunately, that bird is no ordinary one. We believe you know that already. At the very least, the bigness and the claws on the wings would have given it away. So, you should be thinking about a massive bat, shouldn't you?\n\nHowever, it can't be a bat, not without that pentadactyl. Even if it did, how do you explain the crest on its head? Only the pterosaurs are known with such characteristics. But they went extinct 66 million years ago, or that's what we believe. What if they never left? Well, we leave that to you. \n\nhttps://www.google.com/amp/s/www.dailymail.co.uk/news/article-3225044/amp/Special-effects-return-Pterosaur-Amateur-footage-appears-capture-extinct-flying-reptile-surveying-sky-Ohio.html\n\nNumber 8: The Mokele-Mbembe\n\nAt some point, you must have wondered the possibility of a myth becoming true someday. Just take brief research into Ogopogo and the legend of the Leviathan. You'll see that they all have a basis on something in reality. \n\nLook at the Kraken, for example. The existence of a giant squid inspired it. The Mokele-Mbembe is no different. But the good news, we have its basis caught on camera!\n\nInitially hard to find, this picture, which looks out of focus, is one of the very few you can trace to the profile of the Mokele-mbembe. That monster with a long whippy neck endowed with a weight at least twice that of a hippopotamus. If the details are accurate, the Mokele-mbembe must surely be a dinosaur. Perhaps, a kind of sauropod in the family of dinosaurs with four legs. \n\nBelieved to inhabit the Congo basin, the Mokele is a swimmer that lives in caves and a killer that eats leaves. Yes, we know. A few blurry portrayals and videos of testament is not enough to convince the science world. If this turns out to be real, then what next?",
