        "title": "10 Mythical CREATURES That Actually Existed",
        "description": "10 Mythical CREATURES That Actually Existed\n\nIf you're new, Subscribe! → http://goo.gl/djmfuX\n\nFacebook: https://www.facebook.com/Top5BestShow\n\nTop 5 Best is the #1 place for all your heart warming stories about amazing people that will inspire you everyday. Make sure to subscribe and never miss a single video!\n\nLeave a like for more shark tank, pawn stars, dr. phil, and other tv show business content. On Top 5 Best, we like to help you in mindset productivity, whether it's how to make more money videos, or going over the biggest mansions in the world, we show everything here! Make sure to subscribe for more amazing videos everyday!\n\nfamily friendly pg clean\n\n#viralstory #amazingpeople #top5best\n\n10 Mythical Creatures That Actually Existed\nWho doesn’t love a good story, especially ones which involve unbelievable, mythological creatures that\nyou wouldn’t remotely think are real. But, as history has proven, there is a basis for which these\ncreatures were thought up. Today, we will be looking at 10 mythical creatures that actually existed.\nNumber one will make you question whether middle earth was real or not so stay tuned for that.\n\nNumber 10. The Dire Wolf\nDire Wolves became widely popular when Game of Thrones hit the mainstream. These large wolves are\na constant companion of the Starks in the show, and are shown to be large, intelligent, and protective\ncreatures. They aren’t, however, merely just a figment of George RR Martin’s imagination. They are in\nfact, based on real animals.\nDire wolves lived during the Pleistocene, between 250,000 to roughly 10,000 years ago. Unfortunately,\nreal dire wolves were not really the size of ponies. They were larger than modern wolves, though, and\ncould weigh as much as 200 pounds — almost twice what a very large modern wolf might weigh.\nTheir skulls are much larger compared to today’s modern wolves. Ironically though, their brains are\nmuch smaller. However, if they had bigger brains, we probably wouldn’t have had amazing fossils of\nthem. Thousands of dire wolf fossils have been found in the La Brea tar pits. Scientists believe that they\nwere trapped there when they started feeding on the carcasses of other animals trapped in the tar.\n\nNumber 9. The Unicorn\nPerhaps the earliest account of unicorns is by well-known Greek historian, Ctesias, who described a large\nanimal with a horn on its forehead in India. It’s quite possible that he saw a rhino from a distance and\nthought it was a horse with horn on its head. But fossils unearthed in Siberia may have proven the\nexistence of this mythical creature.\nCalled the Siberian unicorn, it was 1.8 meters tall, over 4 meters long and weighed more than 4 tons. It\nwas covered in a shaggy coat and earned its nickname from the huge horn that grew out of its forehead.\nYes, it doesn’t quite resemble the classic unicorn of lore but so far, this is the closest that we can get to a\nreal one.\nThey were believed to have died out 350,000 years ago, but a discovery of a fossil in Kazakhstan\nchanged all that. Carbon dating test revealed the fossil to be only 29,000 years old. This means that the\nanimal roamed the earth 321,000 years longer than previously thought.\n\nNumber 8. The Komodo Dragon\nBelieve it or not, the Komodo Dragon was considered a mythical creature all the way up to 1910 when it\nwas first discovered. Prior to that, rumors were spreading that eight-foot-long, hundred pound\nprehistoric lizards were living on a remote Indonesian island.\n\nWanting to prove or disprove the existence of these creatures himself, Dutch colonial official Lt. Steyn\nvan Hensbroek put together an expedition to Komodo Island. He was able to catch and kill a six-foot\nspecimen, and he sent the carcass as proof to the Zoological Museum and Botanical Garden at Bogor,\nJava.\nSeemingly not satisfied with the discovery, American explorer W. Douglas Burden decided to put\ntogether an expedition himself, making up his mind to catch live specimens. In the end the expedition\nwas able to pile several dead and two live Komodo dragons onto their steamer and return to New York\nCity, giving scientists plenty to study and visitors of the Bronx Zoo plenty to see.\n\nNumber 7. The Bunyip\nThe bunyip is a little like Australia&#39;s Loch Ness monster in that it lives in the water and has never been\nphotographed despite the fact that hundreds of people have seen it. But the legend might have actually\nhad rational origins.\nThe bunyip is an Aboriginal legend — according to Australian History, the name means &quot;devil&quot; or &quot;spirit&quot;\nand the creature is said to look like a cross between a crocodile and a horse, though accounts differ.\nBunyips stalk and kill human beings and supposedly make an eerie sound like a &quot;hollow boom,&quot; which\ncertainly seems terrifying if you&#39;ve never been around any shotguns or farm equipment.",
