        "text": "i know this comment will be buried in the comment section but i had a fear of balloons till i was 16 sad i know right whelp that fear stared when i was 2 my mom left me with here friend 3 guys i think or 2 i don&#39;t know any who as very young me was being baby sit by my mothers friend they had found or bought balloons i don&#39;t my mom told me this annnnd i don&#39;t know i don&#39;t  remember a lot but they thought it be  GREAT idea to blow up those balloons and make that squeaking sound when your rub it with you fingers mind you this i&#39;m slightly autistic i didn&#39;t like sounds like that especially popping balloons so any who they thought it be funny to CHASE ME while i&#39;m crying and screaming i guess my mother came home to me crying my eyes out and i guess they told my mother what they did and she was PISSED she yelled at them some stuff about doing that to me at a young age  i don&#39;tremember but what i do remember when that fear got stuck with me is when my sister room was getting ready my family with some family friends blew up blue balloons(the machine that told the baby gender  messed up and showed that my sister was a boy but a week later we find out she a girl but whatever) for her arrival with a blue room and a white crib well while they were blowing up the balloons my younger self grab and much as balloons i could (one at a time) took the balloons and threw them in the crib and repeated over and over another time i was 14-15 i was volunteering for a pep rally (i was picked to play two games with my friend) i remember telling us to grab balloons and make a line so they can sew the balloon on a string (they sew the balloons at the knot area to make and arch with a PVC pipe) my body was telling me YOU GOT THIS but my brain was telling me it was fear time so i grab ONE balloon held it by the knot and put it far away from me as possible then used my other arm to cover both of my ear i knew i look dumb but i didn&#39;t like balloons popping i&#39;m fine with fireworks it was just with balloons that scared me my friend ask me if i was ok i told her i have fear of balloons only 2 balloons popped but i knew it was coming now i&#39;m 19 and no longer scared of balloons OH i remember when my sister was younger she was playing with a balloon that we got from the bank and i guess my dad saw i was getting scared and putting the balloon where she couldn&#39;t reach it and told me that balloons pop when they touch something sharp or if you yelled in it he proceed to yell in to show me that i shouldn&#39;t be afraid i still was afraid and when to my room to watch super hero squad to calm my nerves it worked but yea i was scared of balloon because 2 or 3 dickhead scared me and chased me with them",
